import React from 'react';
import Card from '../UI/Card';

function AddUser() {
  return (
    <Card className={classes.input}>
        <form>
            <label>Username</label>
            <input type="text"/>
            <label>Age (Years)</label>
            <input type="number" min="13" step="1"/>
        </form>
    </Card>
  );
}

export default AddUser;
